import React from "react";
import Box from '@material-ui/core/Box';
import {Stage, Layer, Group, Text} from 'react-konva';
import Konva from 'konva';

import Paper from '@material-ui/core/Paper';
import IconButton from '@material-ui/core/IconButton';


import ZoomOutOutlinedIcon from '@material-ui/icons/ZoomOutOutlined';
import ZoomInOutlinedIcon from '@material-ui/icons/ZoomInOutlined';
import EditOutlinedIcon from '@material-ui/icons/EditOutlined';
import RotateRightOutlinedIcon from '@material-ui/icons/RotateRightOutlined';
import DeleteForeverOutlinedIcon from '@material-ui/icons/DeleteForeverOutlined';

import TransformerComponent from "./transform.component";
import UrlImage from './urlImage.component';
// import './canvas.css';

// import product from '../../jsons/product.json';

import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";

import {useSelector} from 'react-redux';
import {selectImages} from '../modal-upload-images/uploadSlicer';

const EditorComponent = () => {
    const [selectedShapeName, setSelectedShapeName] = React.useState(null);
    const reduceImages = useSelector(selectImages);

    const handleStageMouseDown = e => {
        if (e.target === e.target.getStage()) {
            setSelectedShapeName(null)
            return;
        }
        const clickedOnTransformer =
            e.target.getParent().className === "Transformer";
        if (clickedOnTransformer) {
            return;
        }
        const name = e.target.name();
        // const rect = this.state.rectangles.find(r => r.name === name);
        if (name) {
            setSelectedShapeName(name);
        } else {
            setSelectedShapeName(null);
        }
    };


    return (
        <Box>
            <Stage id="container" width={600} height={600}
                   style={{
                       border: "5px solid #999",
                       backgroundColor: "#ccc"
                   }}
                   onMouseDown={handleStageMouseDown}
            >
                <Layer>
                    <Group
                        name="group"
                        x={0}
                        y={0}
                        width={600}
                        height={600}
                        fill="red"
                        draggable={true}
                    >
                        <UrlImage
                            src={reduceImages[0] || 'data:image/jpeg;base64,'}
                            x={0}
                        />
                    </Group>
                    <Group
                        name="group"
                        x={100}
                        y={400}
                        width={500}
                        height={60}
                        draggable={true}
                    >
                        <Text
                            name="text"
                            shadowBlur={10}
                            shadowColor="#000"
                            fontSize={54}
                            fontFamily="Calibri"
                            fill="#fff"
                            width={400}
                            padding={15}
                            align="center"
                            text="Digite um texto aqui"
                        />
                    </Group>
                    <TransformerComponent
                        selectedShapeName={selectedShapeName}
                    />
                </Layer>
            </Stage>

            <Box width={600} mt={2}>
                <Grid container>
                    <Grid item xs={2}>
                        <Paper>
                            <IconButton>
                                <ZoomOutOutlinedIcon/>
                                <Typography variant="subtitle2">
                                    Zoom Out
                                </Typography>
                            </IconButton>
                        </Paper>
                    </Grid>
                    <Grid item xs={2}>
                        <Paper>
                            <IconButton>
                                <ZoomInOutlinedIcon/>
                                <Typography variant="subtitle2">
                                    Zoom In
                                </Typography>
                            </IconButton>
                        </Paper>
                    </Grid>
                    <Grid item xs={2}>
                        <Paper>
                            <IconButton>
                                <EditOutlinedIcon/>
                                <Typography variant="subtitle2">
                                    Edit image
                                </Typography>
                            </IconButton>
                        </Paper>
                    </Grid>
                    <Grid item xs={2}>
                        <Paper>
                            <IconButton edge="end">
                                <RotateRightOutlinedIcon/>
                                <Typography variant="subtitle2">
                                    Rotate Image
                                </Typography>
                            </IconButton>
                        </Paper>
                    </Grid>
                    <Grid item xs={2}>
                        <Paper>
                            <IconButton>
                                <DeleteForeverOutlinedIcon/>
                                <Typography variant="subtitle2">
                                    Remove Image
                                </Typography>
                            </IconButton>
                        </Paper>
                    </Grid>
                    <Grid item xs={2}>

                    </Grid>
                    <Grid item xs={2}>

                    </Grid>
                    <Grid item xs={1}>

                    </Grid>
                    <Grid item xs={1}>

                    </Grid>
                    <Grid item xs={1}>

                    </Grid>
                </Grid>
            </Box>
        </Box>
    );

}
export default EditorComponent;
